import React, { useState, useEffect } from 'react'
import API_URL from "../util/apiUrl.js"
import { getTodoLists } from '../path/to/apiMethods' // ajustez le chemin selon vos fichiers

export default function TodoList() {
  const [todos, setTodos] = useState([])
  const [count, setCount] = useState(0)
  const [newTodoText, setNewTodoText] = useState('')
  const [filter, setFilter] = useState('all')

  useEffect(() => {
    const username = 'user123' // À remplacer par l'utilisateur connecté
    const token = 'token123' // À remplacer par le token actuel
    getTodoLists(username, token)
      .then((data) => {
        setTodos(data)
        setCount(data.filter(item => item.done).length)
      })
      .catch((error) => console.log('Erreur de chargement:', error))
  }, [])

  const updateCount = offset => {
    setCount(count + offset)
  }

  const updateItem = id => {
    const newTodos = todos.map((item) => {return {id: item.id, content: item.content, done: (item.id == id) ? ! item.done : item.done}})
    setTodos(newTodos)
    setCount(newTodos.filter(item => item.done).length)
  }

  const deleteTodo = (id) => {
    const token = 'token123' // À remplacer par le token actuel
    deleteTodoList(id, token)
      .then(() => {
        const newTodos = todos.filter(item => item.id !== id)
        setTodos(newTodos)
        setCount(newTodos.filter(item => item.done).length)
      })
      .catch((error) => console.log('Erreur de suppression:', error))
  }

  const addNewTodo = () => {
    if (newTodoText === '') return

    const username = 'user123' // À remplacer par l'utilisateur actuel
    const token = 'token123' // À remplacer par le token actuel
    createTodoList(username, newTodoText, token)
      .then((newTodo) => {
        setTodos([...todos, { id: newTodo.id, content: newTodo.title, done: false }])
        setNewTodoText('')
        setCount(count + 1)
      })
      .catch((error) => console.log('Erreur d\'ajout:', error))
  }

  const checkAll = () => {
    const newTodos = todos.map((item) => {return {id: item.id, content: item.content, done: true}})
    setTodos(newTodos)
    setCount(newTodos.filter(item => item.done).length);
    console.log(newTodos)
  }

  const reversedcheckAll = () => {
    const newTodos = todos.map((item) => {return {id: item.id, content: item.content, done: false}})
    setTodos(newTodos)
    setCount(newTodos.filter(item => item.done).length);
    console.log(newTodos)
  }

  const getFilteredTodos = () => {
    if (filter === 'done') {
      return todos.filter(item => item.done);
    } else if (filter === 'not_done') {
      return todos.filter(item => !item.done);
    } else {
      return todos;
    }
  };

  return (
      <View style={{ margin: 10 }}>
        <Text>{count} items réalisés</Text>
        <View style={styles.buttonGroup}>
          <Button title="Toutes" onPress={() => setFilter('all')} />
          <Button title="Tâches effectuées" onPress={() => setFilter('done')} />
          <Button title="Tâches non effectuées" onPress={() => setFilter('not_done')} />
        </View>
        <View style={styles.textInput_group}>
          <View>
            <TextInput
              style={styles.textinput_view}
              onChangeText={setNewTodoText}
              placeholder='saisir ici un nouvel item'
              onSubmitEditing={addNewTodo}
              value={newTodoText}
            />
          </View>
          <View style={styles.buttoninput_view}>
            <Button onPress={addNewTodo} title='new' />
          </View>
        </View>
        <FlatList
          style={{ paddingLeft: 10 }}
          data={getFilteredTodos()}
          renderItem={({ item }) => (
            <TodoItem
              item={item}
              updateItem={updateItem}
              deleteTodo={deleteTodo}
            />
          )}
        />
        <Button onPress = {checkAll} title='tout selctionner'/>
        <Button onPress = {reversedcheckAll} title='tout deselctionner'/>
      </View>
  )
}

const styles = StyleSheet.create({
  textInput_group: {
    flexDirection: 'row'
  },
  textinput_view: {
    margin: 12,
    borderWidth: 1,
    padding: 10
  },
  buttoninput_view: {
    margin: 12,
    paddingTop: 3
  }
})
